import Avatar from "./Avatar";

function Profile({ nome, profissao, premios, descobertas }) {
  return (
    <div style={{ border: "1px solid black" }}>
      <h1>{nome}</h1>
      <Avatar />
      <ul>
        <li>Profession:{profissao}</li>
        <li>Awards:{premios}</li>
        <li>Discovereds:{descobertas}</li>
      </ul>
    </div>
  );
}

export default Profile;
